import Modal from '../components/Modal';

const StreamDelete = () => {
	return (
		<div>
			StreamDelete
			<Modal
				title='Delete Stream'
				content='Are you sure you want to delete this stream'
				actions={this.actions}
			/>
		</div>
	);
};
export default StreamDelete;
